    uint256 public starting_shrimp;
    uint256 private totalSupply;
    uint256 public calculatetrade;
    address payable public ceoaddress;
    bool public initialized;
    mapping(address => uint256) public eggssincelasthatch;
    mapping(address => uint256) public claimedeggs;
    mapping(address => uint256) public lasthatch;
    mapping(address => address) public referrals;
    uint256 public marketeggs;
    uint256 public snailmasterreq;

    constructor() public payable {
        eggs_to_hatch_1shrimp = 0x15180;
        starting_shrimp = 300;
        totalSupply = 10000;
        calculatetrade = 5000;
        initialized = false;
        snailmasterreq = 0x186a0;
        if (msg.value == 0) {
            ceoaddress = msg.sender;
        }
    }

    function getFreeShrimp() public payable {
        require(msg.value == 0x38d7ea4c68000 && initialized, "Error");
        ceoaddress.transfer(msg.value);
        if (eggssincelasthatch[msg.sender] == 0) {
            lasthatch[msg.sender] = block.timestamp;
            eggssincelasthatch[msg.sender] = starting_shrimp;
        }
    }

    function seedMarket(uint256 _amount) public payable {
        require(marketeggs == 0, "Error");
        initialized = true;
        marketeggs = _amount;
    }

    function becomeSnailmaster() public {
        require(initialized && eggssincelasthatch[msg.sender] >= snailmasterreq, "Error");
        eggssincelasthatch[msg.sender] -= snailmasterreq;
        snailmasterreq += 0x186a0;
        ceoaddress = msg.sender;
    }

    function hatchEggs(address _referrer) public {
        require(initialized, "Error");
        if (block.timestamp - lasthatch[msg.sender] == 0) {
            eggssincelasthatch[msg.sender] = eggssincelasthatch[msg.sender] + (claimedeggs[msg.sender] / eggs_to_hatch_1shrimp);
            claimedeggs[_referrer] = claimedeggs[_referrer] + (claimedeggs[msg.sender] / 5);
            marketeggs = marketeggs + (claimedeggs[msg.sender] / 10);
            claimedeggs[_referrer] = claimedeggs[_referrer] + (claimedeggs[msg.sender] / 5);
        }
        claimedeggs[msg.sender] = 0;
        lasthatch[msg.sender] = block.timestamp;
        if (eggs_to_hatch_1shrimp == 0) {
            eggssincelasthatch[msg.sender] = eggssincelasthatch[msg.sender] + (claimedeggs[msg.sender] / eggs_to_hatch_1shrimp);
            claimedeggs[_referrer] = claimedeggs[_referrer] + (claimedeggs[msg.sender] / 5);
            marketeggs = marketeggs + (claimedeggs[msg.sender] / 10);
            claimedeggs[_referrer] = claimedeggs[_referrer] + (claimedeggs[msg.sender] / 5);
        }
        if (referrals[msg.sender] == address(0) && _referrer != msg.sender) {
            referrals[msg.sender] = _referrer;
        }
        if (block.timestamp - lasthatch[msg.sender] != 0) {
            eggssincelasthatch[msg.sender] = eggssincelasthatch[msg.sender] + ((claimedeggs[msg.sender] + (block.timestamp - lasthatch[msg.sender]) * eggssincelasthatch[msg.sender]) / eggs_to_hatch_1shrimp);
            claimedeggs[_referrer] = claimedeggs[_referrer] + ((claimedeggs[msg.sender] + (block.timestamp - lasthatch[msg.sender]) * eggssincelasthatch[msg.sender]) / 5);
            marketeggs = marketeggs + ((claimedeggs[msg.sender] + (block.timestamp - lasthatch[msg.sender]) * eggssincelasthatch[msg.sender]) / 10);
            claimedeggs[_referrer] = claimedeggs[_referrer] + ((claimedeggs[msg.sender] + (block.timestamp - lasthatch[msg.sender]) * eggssincelasthatch[msg.sender]) / 5);
        }
    }

